import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Accueil from './components/Accueil'; // Chemin relatif depuis src
import Appartement from './components/Appartement'; // Chemin relatif depuis src
import appartementsData from './data/appartements.json';

function App() {
  return (
    <BrowserRouter>
      <Routes>
      <Route exact path="/" render={() => <Accueil appartements={appartementsData} />} />
          <Route path="/appartements/:id" render={({ match }) => <Appartement match={match} appartements={appartementsData} />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
